const StudentDetails = ({ student }) => {
    return (
        <div className="student-details">
            <p>Nmae: {student.name}</p>
            <p>Roll: {student.rollNum}</p>
            <p>Class: {student.sclassName}</p>
        </div>
    )
}

export default StudentDetails
